import {motion} from 'framer-motion';

export default function Header() {
    const parentVariant = {
        initial : {}, 
        animate: {}, 
    }
    const childrenVariant = {
        initial : {opacity: 0}, 
        animate: {opacity: 1}, 
    }

    return (
        <motion.h1 
          className="header"
          variants={parentVariant}
          initial="initial"
          animate="animate"
          >
            <motion.span
              variants={childrenVariant}
            >G</motion.span>
            <motion.span>i</motion.span>
            <motion.span>f</motion.span>
            <motion.span>t</motion.span>
            <motion.span>i</motion.span>
            <motion.span>n</motion.span>
            <motion.span>g</motion.span>
            i
            fting made 
        
        <span className="gradientText">easier</span>
        </motion.h1>
    );
}
